import Server from "./Server";

function ServerList() {
    return (
      <div className="ServerList">
        <table class="table table-hover">
          <thead>
            <tr>
            <th scope="col">#</th>

              <th scope="col">Server</th>
              <th scope="col">Distance</th>
            </tr>
          </thead>
          <tbody>
            <Server></Server>
            <Server></Server>
          </tbody>
        </table>
      </div>
    );
  }

  export default ServerList;
